Member.Description:
This field is present in the PeripheralInfo message
if at least one of these things happens:
1) The bit 15 of ProtocolCap is set to 1;
2) It will be necessary to add other fields in queue, after the field ExtendedProtCap.
It is reserved for future extensions of ProtocolCap field.

Current device error:
- NoError: Device answered as expected;
- Offline: Device did not answer (offline);
- InvalidPacket: Device answered with an invalid packet;
- ErrorCodeReceived: Device answered with an error code;
- NotYetQueried: Device has yet to be queried.

