Member.Description:
The backup mode:
- DISABLED_MODE : Retain backup disabled (performed only on demand);
- BLOCKING_MODE : Retain blocking backup every "interval" milliseconds;
- ASYNCHRONUOS_MODE : Retain asynchronuos backup every "interval" milliseconds.

