FunctionBlockType.Description:
TON - On-delay timing - state machine. Timer on delay supplies the input value IN at Q with a time delay when a rising edge is detected at IN. If input IN is only '1' for a short pulse(shorter than PT), the timer is not started for this edge.
@example +--------+ +---+ +--------+ IN | | | | | | --+ +--------+ +---+ +------------- t0 t1 t2 t3 t4 t5 +---+ +---+ Q | | | | -------+ +---------------------+ +------------- t0+PT t1 t4+PT t5 PT +---+ +---+ : / | + / | ET : / | /| / | : / | / | / | : / | / | / | 0-+ +--------+ +---+ +------------- t0 t1 t2 t3 t4 t5
2 +---+ +---+ STATE 1 +----+ | +---+ +----+ | 0 --+ +--------+ +---+ +------

